import React from "react";
import styles from './Button.module.css';

const Button = (props) =>{
    return(
        <button 
        className={`${styles['button']} ${styles.blue}`} 
        type={props.type || 'button'} 
        onClick={props.onClick}>
            {props.children}
        </button>
    );
}

export default Button;
